import React, { Component } from "react";
import googleLogo from "../assets/icon/google-logo.png"
import facebookLogo from "../assets/icon/facebook-logo.png"
import twitterLogo from "../assets/icon/twitter-logo.png"

class Login extends Component {
  render() {
    return (
      <div>
        <div
          className="col-md-6 d-flex flex-column justify-content-center align-items-center"
          style={{
            paddingLeft: "200px",
            paddingRight: "200px",
          }}
        >
          <h1 className="w-100 text-center fw-bold"> Sign in to Clever </h1>{" "}
          <div className="d-flex justify-content-center my-3">
            <a
              href=""
              className="rounded rounded-5 bg-light p-4 m-2 icon-container"
            >
              <img src={googleLogo} className="icon" alt="" />
            </a>{" "}
            <a
              href=""
              className="rounded rounded-5 bg-light p-4 m-2 icon-container"
            >
              <img src={facebookLogo} className="icon" alt="" />
            </a>{" "}
            <a
              href=""
              className="rounded rounded-5 bg-light p-4 m-2 icon-container"
            >
              <img src={twitterLogo} className="icon" alt="" />
            </a>{" "}
          </div>{" "}
          <div
            className="w-100 d-flex justify-content-center align-items-center bg-secondary my-4 mb-0"
            style={{
              height: "2px",
            }}
          >
            <small className="bg-white m-0 px-3 py-2">
              {" "}
              or do it via E - mail{" "}
            </small>{" "}
          </div>{" "}
          <form action="" className="m-0 p-0 w-100">
            <label
              htmlFor="email"
              className="text-capitalize fw-bold d-flex flex-column w-100 my-4"
            >
              Email{" "}
              <input
                type="text"
                className="rounded rounded-4 mt-1 p-3 text-secondary bg-light border-0 text-secondary"
                placeholder="adresse@mail.com"
              />
            </label>{" "}
            <label
              htmlFor="email"
              className="text-capitalize fw-bold d-flex flex-column w-100 my-4"
            >
              Password{" "}
              <input
                type="password"
                className="rounded rounded-4 mt-1 p-3 text-secondary bg-light border-0 text-secondary"
                placeholder="password"
              />
              <small className="text-secondary fw-bold mt-1">
                {" "}
                Must be 8 character at least{" "}
              </small>{" "}
            </label>{" "}
            <div className="d-flex justify-content-between w-100 my-4">
              <div class="form-check">
                <input
                  type="checkbox"
                  className="form-check-input"
                  name=""
                  id=""
                  value="checkedValue"
                  checked
                />
                <label className="form-check-label" for="">
                  Remember me{" "}
                </label>{" "}
              </div>{" "}
              <a href="" className="text-primary text-capitalize fw-bold">
                {" "}
                forgot password ?{" "}
              </a>{" "}
            </div>{" "}
            <button className="btn btn-primary w-100 my-4 rounded rounded-5">
              {" "}
              Sign in{" "}
            </button>{" "}
          </form>{" "}
          <small className="text-center text-secondary my-4 text-capitalize">
            @2021 all right reserved{" "}
          </small>{" "}
        </div>{" "}
      </div>
    );
  }
}

export default Login;
